import React, { Component } from "react";
import MyTabNav from "../components/MyTabNav";

import data from "../data/data";

class App extends Component {
  constructor(props) {
    super(props);
    this.projectNames = Object.keys(data);
    this.updateNewNote = this.updateNewNote.bind(this);
  }

  updateNewNote = (newNoteName, newNoteType, currentProject) => {
    let tempData = [{ type: newNoteType, title: newNoteName }];
    data[currentProject].push(tempData);
    console.log(data)
    // this.projectNames.push(newProject);
  };

  render() {
    return (
      <div className="container">
        <MyTabNav projectNames={this.projectNames} projectMap={data} updateNewNote={this.updateNewNote}/>
      </div>
    );
  }
}

export default App;
